import styled from '@emotion/styled';

export const StyledInput = styled.input`
  width: 100%;
  height: 30px;
  border-radius: 2px;
  padding: 5px;
  border: 1px solid #ccc;

  &:focus {
    outline: none;
    border: 1px solid #0d8ade;
  }
`;
